

def first_digits(number,total_digits,first_digits):
    a=number/(10**(total_digits-first_digits))
    return product_of_digits(a,first_digits)

def another_function_that_can_loop(number,total_digits,first_digits):
    while total_digits >= first_digits:
        first_digits(number,total_digits,first_digits)
        total_digits=total_digits-1
        number=number%(10**total_digits)


def product_of_digits(number,total_digits):
    product=1
    while total_digits > 0:
        digit=number%10
        product=product*digit
        number=number/10
        total_digits=total_digits-1
    return product    

print(product_of_digits(23322,3))
